const qs = require('query-string');
const urlencode = require('urlencode');
const request = require('superagent');
const express = require('express');
const _ = require('lodash');
const moment = require('moment');
const md5 = require('md5');

const baseUrl = 'https://api.ai.qq.com/fcgi-bin/nlp/nlp_speechtranslate',
  app_key = 'pcndlXD8nPLBdWr4',
  app_id = '1106828862'

function dictSort(params) {
  let sortKeys = Object.keys(params).sort();
  let retObj = {}
  sortKeys.forEach(key => {
    retObj[key] = params[key];
  })
  return retObj;
}

function sign(AccessKeySecret, params) {
  let sortRes = dictSort(params);
  return _.toUpper(md5(`${qs.stringify(sortRes)}&app_key=${AccessKeySecret}`));
}

const headers = {
  'Content-Type': 'application/x-www-form-urlencoded;charset=UTF-8',
  'Accept': 'application/json'
};

const app = express();

app.post('/translate', async function(req, res) {
  let _res = res
  let params = {
    app_id,
    nonce_str: `${new Date().getTime()}${_.random(1000, 9999)}`,
    time_stamp: Math.round(new Date().getTime() / 1000),
    format: 6,
    seq: 0,
    end: 1,
    session_id: `7ipr_demo_${_.random(1000, 9999)}`,
    source: 'zh',
    target: 'en',
    speech_chunk:''
  };
  params.sign = sign(app_key, params);
  try {
    let _res = await request.post(baseUrl).set(headers).send(params)
    res.end(_res.text)
  } catch (e) {
    res.end({
      e: e
    })
  }
});

const server = app.listen(3000, function() {
  const host = server.address().address;
  const port = server.address().port;

  console.log('Example app listening at http://%s:%s', host, port);
});
